def first_unique_char(s):
    frequency = {}
    for i in range(len(s)):
        if not s[i] in frequency:
            frequency[s[i]] = [1, i]
        else:
            frequency[s[i]][0] += 1
    pos = len(s)
    for v in frequency.values():
        if v[0] == 1:
            pos = min(pos, v[1])
    if pos != len(s):
        return -1
    else:
        return (s[pos], pos)

